description.text:
This OpenSCAD script will generate a replacement clip for the plastic hook parts of the rear windscreen blind clips on a mid 1990s Daimler Executive Limousine<br />
This is horribly messy and nor parametric as it was written in the space of a few minutes to match an existing broken and obsucre plastic car part we couldn't get a replacement for!
@author Mark Gaffney<br />
@version 0.1<br />
@date 2013-01-30<br />
